import React from 'react';
import ReactDOM from 'react-dom';
//import './index.css';
import "bootstrap/dist/css/bootstrap.min.css"
import App from './App';
import * as serviceWorker from './serviceWorker';
import CourseListComponent from "./components/CourseListCompent";
import {Login} from "./components/Login";
import {Register} from "./components/Register";
import {Profile} from "./components/Profile";
//import {BrowserRouter, Link, Route} from "react-router-dom";
import {BrowserRouter as Router, Link, Route} from 'react-router-dom'
import {CourseEditor} from "./components/CourseEditor";
ReactDOM.render(
    <Router>
    <div>
      <Link to="login">Login</Link>
      <Link to="register">Register</Link>
      <Link to="profile">Profile</Link>
      <Link to="courses">Courses</Link>

      <Route path="/login" exact component={Login}/>
      <Route path="/register" exact component={Register}/>
      <Route path="/profile" exact component={Profile}/>
      <Route path="/courses" exact component={CourseListComponent}/>
      <Route path="/edit/:courseId" exact component={CourseEditor}/>


    </div>
    </Router>,
  document.getElementById('root')
)
// Route links a certain HTML path to a certain component

// If you want your app to work offline and load faster, you can change
// unregister() to register() below. Note this comes with some pitfalls.
// Learn more about service workers: https://bit.ly/CRA-PWA
serviceWorker.unregister();
